import getUniquieId from "../functions/getUniqueId";

class Product {
  constructor(name, icon, price) {
    this.icon = icon;
    this.name = name;
    this.price = price;
  }
  getProduct() {
    return {
      id: getUniquieId(),
      icon: this.icon,
      name: this.name,
      price: this.price,
    };
  }
}

export default Product;
